    def dt_ext(y, jsd)
      dy = (y-1820)/100.0
      return -20+jsd*dy*dy
    end

    ## 计算世界时与原子时之差,传入年
    def dt_calc(y)
      y0 = DT_AT[DT_AT.length-2] ## 表中最后一年
      t0 = DT_AT[DT_AT.length-1] ## 表中最后一年的deltatT
      if y >= y0 then
