        return dt_ext(y, jsd) if y > y0+100
        v = dt_ext(y, jsd) ## 二次曲线外推
        dv= dt_ext(y0, jsd)-t0 ## ye年的二次外推与te的差
        return v-dv*(y0+100-y)/100.0
      end

