      end
      t1 = (y-DT_AT[i])/(DT_AT[i+5]-DT_AT[i])*10; t2 = t1*t1; t3 = t2*t1
      return DT_AT[i+1]+DT_AT[i+2]*t1+DT_AT[i+3]*t2+DT_AT[i+4]*t3
    end

    ## 传入儒略日(J2000起算),计算TD-UT(单位:日)
    def dt_t(t)
      return dt_calc(t/365.2425+2000)/86400.0
    end

    ## xt星体,zn坐标号,t儒略世纪数,n计算项数 [8行星星历计算]
    def xl0_calc(xt, zn, t, n)
      t /= 10.0 ## 转为儒略千年数
      v = 0; tn = 1
      _f = XL0[xt]
      pn = zn*6+1; _n0 = _f[pn+1]-_f[pn] ## N0序列总数

      i = 0
      while i < 6 do
        n1 = _f[pn+i]; n2 = _f[pn+1+i]; n0 = n2-n1
        next if n0 == 0

        if n < 0 then
          _n = n2 ## 确定项数
        else
          _n = (3*n*n0/_n0+0.5).floor+n1
          _n += 3 if i != 0
          _n = n2 if _n > n2
        end

        j = n1; c= 0
        while j < _n do
          c += _f[j]*Math.cos(_f[j+1]+t*_f[j+2])
          j += 3
        end
        v += c*tn

        i += 1
        tn *= t
      end

      v /= _f[0]
      if xt == 0 then ## 地球
        t2 = t*t; t3 = t2*t ## 千年数的各次方
        v += (-0.0728-2.7702*t-1.1019*t2-0.0996*t3) / RAD if zn == 0
        v += (+0.0000+0.0004*t+0.0004*t2-0.0026*t3) / RAD if zn == 1
        v += (-0.0020+0.0044*t+0.0213*t2-0.0250*t3) / 1000000.0 if zn == 2
      else ## 其它行星
        # 程序中用不到，执行到此处必然是出错了
        raise "r u come from earth?"
=begin
        dv = XL0_XZB[(xt-1)*3+zn]
        if zn == 0 then
          v += -3*t/RAD
        elsif zn == 2 then
          v += dv/1000000.0
        else
          v += dv/RAD
        end
=end
      end
      return v
    end

    ## 计算月亮 [星历]
    def xl1_calc(zn, t, n)
      ob = XL1[zn]
      v = 0; tn = 1
      t2 = t*t; t3 = t2*t; t4 = t3*t; t5 = t4*t; tx = t-10
      if zn == 0 then
        ## 月球平黄经(弧度)
        v += (3.81034409+8399.684730072*t-3.319e-05*t2+3.11e-08*t3-2.033e-10*t4)*RAD
        ## 岁差(角秒)
        v += 5028.792262*t+1.1124406*t2+0.00007699*t3-0.000023479*t4-0.0000000178*t5
        ## 对公元3000年至公元5000年的拟合,最大误差小于10角秒
        v += -0.866+1.43*tx+0.054*tx*tx if tx>0
      end
      t2 /= 1e4; t3 /= 1e8; t4 /= 1e8
      n *= 6; n = ob[0].length if n<0

      i = 0
      while i <ob.length do
        _f = ob[i]
        _n = (n*_f.length/ob[0].length.to_f+0.5).floor
        _n += 6 if i != 0
        _n = _f.length if _n>=_f.length

        j = 0; c = 0
        while j<_n do
          c += _f[j]*Math.cos(_f[j+1]+t*_f[j+2]+t2*_f[j+3]+t3*_f[j+4]+t4*_f[j+5])
          j += 6
        end

        v += c*tn

        i += 1
        tn *= t
      end

      v /= RAD if zn != 2
      return v
    end

    ## 地球经度计算,返回Date分点黄经,传入世纪数、取项数
    def e_lon(t, n)
      return xl0_calc(0, 0, t, n)
    end

    ## 月球经度计算,返回Date分点黄经,传入世纪数,n是项数比例
    def m_lon(t, n)
      return xl1_calc(0, t, n)
    end

    ## 地球速度,t是世纪数,误差小于万分3
    def e_v(t)
      f = 628.307585*t
      return 628.332+21*Math.sin(1.527+f)+0.44*Math.sin(1.48+f*2)+0.129*Math.sin(5.82+f)*t+0.00055*Math.sin(4.21+f)*t*t
    end

    ## 月球速度计算,传入世经数
    def m_v(t)
      v = 8399.71-914*Math.sin(0.7848+8328.691425*t+0.0001523*t*t ) ## 误差小于5%
      v -= (179*Math.sin( 2.543  +15542.7543*t ) + ## 误差小于0.3%
            160*Math.sin( 0.1874 + 7214.0629*t ) +
            62 *Math.sin( 3.14   +16657.3828*t ) +
            34 *Math.sin( 4.827  +16866.9323*t ) +
            22 *Math.sin( 4.9    +23871.4457*t ) +
            12 *Math.sin( 2.59   +14914.4523*t ) +
            7  *Math.sin( 0.23   + 6585.7609*t ) +
            5  *Math.sin( 0.9    + 25195.624*t ) +
            5  *Math.sin( 2.32   - 7700.3895*t ) +
            5  *Math.sin( 3.88   + 8956.9934*t ) +
            5  *Math.sin( 0.49   + 7771.3771*t ) )
        return v
    end

    ## 计算黄经章动
    def nutation_lon2(t)
      t2 = t*t; d_l = 0; _b = NUTB
      i = 0
      while i < _b.length do
        a = i == 0 ? -1.742*t : 0
        d_l += (_b[i+3]+a)*Math.sin(_b[i]+_b[i+1]*t+_b[i+2]*t2)
        i += 5
      end
      return d_l/100.0/RAD
    end

    ## 太阳光行差,t是世纪数
    def gxc_sun_lon(t)
      v = -0.043126+628.301955*t-0.000002732*t*t ## 平近点角
      e = 0.016708634-0.000042037*t-0.0000001267*t*t
      return (-20.49552*(1+e*Math.cos(v)))/RAD ## 黄经光行差
    end

    ## 太阳视黄经
    def s_alon(t, n)
      ## 注意，这里的章动计算很耗时
      return e_lon(t, n) + nutation_lon2(t) + gxc_sun_lon(t) + Math::PI
    end

    ## 已知太阳视黄经反求时间
    def s_alon_t(_w)
      v = 628.3319653318
      t = (_w-1.75347-Math::PI)/v
      v = e_v(t) ## v的精度0.03%，详见原文
      t += (_w-s_alon(t, 10))/v
      v = e_v(t) ## 再算一次v有助于提高精度,不算也可以
      t += (_w-s_alon(t, -1))/v
      return t
    end

    ## 已知太阳视黄经反求时间,高速低精度,最大误差不超过600秒
    def s_alon_t2(_w)
      v = 628.3319653318
      t = (_w-1.75347-Math::PI)/v;
      t -= (0.000005297*t*t+0.0334166*Math.cos(4.669257+628.307585*t)+0.0002061*Math.cos(2.67823+628.307585*t)*t)/v
      t += (_w-e_lon(t,8)-Math::PI+(20.5+17.2*Math.sin(2.1824-33.75705*t))/RAD)/v
      return t
    end

    ## 月球经度光行差,误差0.07"
    def gxc_moon_lon(t)
      return -3.4E-6
    end

    ## 月日视黄经的差值
    def ms_alon(t, _mn, _sn)
      return m_lon(t, _mn) + gxc_moon_lon(t) - (e_lon(t, _sn) + gxc_sun_lon(t) + Math::PI)
    end

    ## 已知月日视黄经差求时间
    def ms_alon_t(_w)
      v = 7771.37714500204
      t = (_w + 1.08472)/v;
      t += (_w - ms_alon(t,3,3))/v
      v = m_v(t) - e_v(t) # v的精度0.5%，详见原文
      t += (_w - ms_alon(t,20,10))/v
      t += (_w - ms_alon(t,-1,60))/v
      return t
    end

    ## 已知月日视黄经差求时间,高速低精度,误差不超过600秒(只验算了几千年)
    def ms_alon_t2(_w)
      v = 7771.37714500204
      t = (_w + 1.08472 )/v
      t2 = t*t
      t -= (-0.00003309*t2+0.10976*Math.cos(0.784758+8328.6914246*t+0.000152292*t2)+0.02224*Math.cos(0.18740+7214.0628654*t-0.00021848*t2)-0.03342*Math.cos(4.669257+628.307585*t))/v
      _l = m_lon(t,20)-(4.8950632+628.3319653318*t+0.000005297*t*t+0.0334166*Math.cos(4.669257+628.307585*t)+0.0002061*Math.cos(2.67823+628.307585*t)*t+0.000349*Math.cos(4.6261+1256.61517*t)-20.5/RAD)
      v = 7771.38-914*Math.sin(0.7848+8328.691425*t+0.0001523*t*t)-179*Math.sin(2.543+15542.7543*t)-160*Math.sin(0.1874+7214.0629*t)
      t += (_w-_l)/v
      return t
    end

