    ## 对超过0-2PI的角度转为0-2PI
    def rad2mrad(v)
      v = v.remainder(2*Math::PI)
      return v<0 ? v+2*Math::PI : v
    end

    ## 对超过-PI到PI的角度转为-PI到PI
    def rad2rrad(v)
      v = v.remainder(2*Math::PI)
      return v+2*Math::PI if v<=-Math::PI
      return v-2*Math::PI if v>Math::PI
      return v
    end

    ## 球面坐标旋转
    def llr_conv(_j_w, _e)
      ## 黄道赤道坐标变换,赤到黄E取负
      r = [0, 0, 0]
      _j = _j_w[0]; _w = _j_w[1]
      r[0] = Math.atan2(Math.sin(_j)*Math.cos(_e)-Math.tan(_w)*Math.sin(_e), Math.cos(_j))
      r[1] = Math.asin(Math.cos(_e)*Math.sin(_w)+Math.sin(_e)*Math.cos(_w)*Math.sin(_j))
      r[2] = _j_w[2]
      r[0] = rad2mrad(r[0])
      return r
    end

    ## 时差计算(低精度),误差约在1秒以内,t力学时儒略世纪数
    def pty_zty2(t)
      _l = (1753470142+628331965331.8*t+5296.74*t*t)/1000000000.0 + Math::PI
      z = []
      _e = (84381.4088-46.836051*t)/RAD
      z[0] = xl0_calc(0, 0, t, 5)+Math::PI; z[1] = 0 ## 地球坐标
      z = llr_conv(z, _e) ## z太阳地心赤道坐标
      _l = rad2rrad(_l-z[0])
      return _l/(Math::PI*2) ## 单位是周(天)
    end
