      s.gsub!(/n/,'00000002')
      s.gsub!(/m/,'000000002')
      s.gsub!(/l/,'0000000002')
      s.gsub!(/k/,'01')
      s.gsub!(/j/,'0101')
      s.gsub!(/i/,'001')
      s.gsub!(/h/,'001001')
      s.gsub!(/g/,'0001')
      s.gsub!(/f/,'00001')
      s.gsub!(/e/,'000001')
      s.gsub!(/d/,'0000001')
      s.gsub!(/c/,'00000001')
      s.gsub!(/b/,'000000001')
      s.gsub!(/a/,'0000000001')
      s.gsub!(/A/,o2+o2+o2)
      s.gsub!(/B/,o2+o2+o)
      s.gsub!(/C/,o2+o2)
      s.gsub!(/D/,o2+o)
      s.gsub!(/E/,o2)
      s.gsub!(/F/,o)
      return s
    end

