    ## 较高精度朔
    def so_high(_w)
      t = ms_alon_t2(_w)*36525
      t = t-dt_t(t)+8.0/24.0
      v = ((t+0.5).remainder(1))*86400
      t = ms_alon_t(_w)*36525-dt_t(t)+8.0/24.0 if v<1800 || v >86400-1800
      return t
    end

    ## jd应靠近所要取得的气朔日,qs='气'时，算节气的儒略日
    def calc(jd, qs)
      jd += 2451545
      if qs then
        _b = QI_KB; pc = 7
      else
        _b = SUO_KB; pc = 14
      end
      f1 = _b[0]-pc; f2 = _b[_b.length-1]-pc; f3 = 2436935.0

      ## 平气朔表中首个之前，使用现代天文算法。1960.1.1以后，使用现代天文算法 (这一部分调用了qi_high和so_high,所以需星历表支持)
      if jd<f1 || jd>=f3 then
        if qs then
          ## 2451259是1999.3.21,太阳视黄经为0,春分.定气计算
          return (qi_high(((jd+pc-2451259)/365.2422*24).floor*Math::PI/12)+0.5).floor
        else
          ## 2451551是2000.1.7的那个朔日,黄经差为0.定朔计算
          return (so_high(((jd+pc-2451551)/29.5306).floor*Math::PI*2)+0.5).floor
        end
      end

      ## 平气或平朔
      if jd>=f1 && jd<f2 then
        i = 0
        while i<_b.length do
          break if jd+pc<_b[i+2]
          i += 2
        end

        _d = _b[i]+_b[i+1]*((jd+pc-_b[i])/_b[i+1]).floor
        _d = (_d+0.5).floor
        ## 如果使用太初历计算-103年1月24日的朔日,结果得到的是23日,这里修正为24日(实历)。修正后仍不影响-103的无中置闰。如果使用秦汉历，得到的是24日，本行_d不会被执行。
        _d += 1 if _d==1683460
        return _d-2451545
      end

      ## 定气或定朔
      if jd>=f2 && jd<f3 then
        if qs then
          ## 2451259是1999.3.21,太阳视黄经为0,春分.定气计算
          _d = (qi_low(((jd+pc-2451259)/365.2422*24).floor*Math::PI/12.0)+0.5).floor
          n = QB[((jd-f2)/365.2422*24).floor] ## 找定气修正值
        else
          ## 2451551是2000.1.7的那个朔日,黄经差为0.定朔计算
          _d = (so_low(((jd+pc-2451551)/29.5306).floor*Math::PI*2)+0.5).floor
          n = SB[((jd-f2)/29.5306).floor] ## 找定朔修正值
        end
        return _d+1 if n=='1'
        return _d-1 if n=='2'
        return _d
      end
    end

    ## 农历排月序计算,可定出农历,有效范围：两个冬至之间(冬至一 <= d < 冬至二)
    ##
    ## 时间系统全部使用北京时，即使是天象时刻的输出，也是使用北京时
    ## 如果天象的输出不使用北京时，会造成显示混乱，更严重的是无法与古历比对
    ##
    ## 在调用后[返回Hash]得到以下数据
    ##
    ## * :leap => int # 闰月位置
    ## * :ym => [] # 各月名称
    ## * :zq => {} # 中气表,其中.liqiu是节气立秋的儒略日,计算三伏时用到
    ## * :hs => [] # 合朔表
    ## * :dx => [] # 各月大小
    #--
    # 月名的部分，原始程序返回中文内容。考虑到处理简繁体的问题，改会返回数组下标。
    #++
    def calc_y(jd)
      __leap = 0; __ym = []; __zq = {}; __hs = []; __dx = []

      ## 该年的气
      _w = ((jd-355+183)/365.2422).floor*365.2422+355  ## 355是2000.12冬至,得到较靠近jd的冬至估计值
      _w -= 365.2422 if calc(_w, true)>jd
      i = 0
      while i<25 do
        ## 25个节气时刻(北京时间),从冬至开始到下一个冬至以后
        __zq[i] = calc(_w+15.2184*i, true)
        i += 1
      end

      ## 补算二气,确保一年中所有月份的“气”全部被计算在内
      __zq[:pe1] = calc(_w-15.2, true)
      __zq[:pe2] = calc(_w-30.4, true)

      ## 今年"首朔"的日月黄经差w
      w = calc(__zq[0], false) ## 求较靠近冬至的朔日
      w -= 29.53 if w>__zq[0]

      ## 该年所有朔,包含14个月的始末
      i = 0
      while i<15 do
        __hs[i] = calc(w+29.5306*i, false)
        i += 1
      end

      ## 月大小
      i = 0
      while i<14 do
        __dx[i] = __hs[i+1]-__hs[i] ## 月大小
        __ym[i] = i ## 月序初始化
        i += 1
      end

      ## -721年至-104年的后九月及月建问题,与朔有关，与气无关
      _yy = ((__zq[0]+10+180)/365.2422).floor + 2000 ## 确定年份
      if _yy>=-721 && _yy <=-104 then
        ns = []
        i = 0
        while i<3 do
          yy = _yy+i-1
          ## 颁行历年首, 闰月名称, 月建
          if yy>=-721 then
            ## 春秋历,ly为-722.12.17
            ns[i] = calc(1457698-J2000+(0.342+(yy+721)*12.368422).floor*29.5306, false)
            #ns[i+3] = '十三'
            ns[i+3] = 12
            ns[i+6] = 2
          end
          if yy>=-479 then
            ## 战国历,ly为-480.12.11
            ns[i] = calc(1546083-J2000+(0.500+(yy+479)*12.368422).floor*29.5306, false)
            #ns[i+3] = '十三'
            ns[i+3] = 12
            ns[i+6] = 2
          end
          if yy>=-220 then
            ## 秦汉历,ly为-221.10.31
            ns[i] = calc(1640641-J2000+(0.866+(yy+220)*12.369000).floor*29.5306, false)
            #ns[i+3] = '后九'
            ns[i+3] = 13
            ns[i+6] = 11
          end
          i += 1
        end

        i = 0
        while i<14 do
          nn = 2
          while nn > 0 do
            break if __hs[i]>=ns[nn]
            nn -= 1
          end
          f1 = ((__hs[i]-ns[nn]+15)/29.5306).floor ## 该月积数
          #__ym[i] = f1<12 ? YMC[(f1+ns[nn+6])%12] : ns[nn+3]
          __ym[i] = f1<12 ? (f1+ns[nn+6])%12 : ns[nn+3]
          i += 1
        end

        return {:leap=>__leap, :ym=>__ym, :zq=>__zq, :hs=>__hs, :dx=>__dx}
      end

      ## 无中气置闰法确定闰月,(气朔结合法,数据源需有冬至开始的的气和朔)
      if __hs[13] <= __zq[24] then
        ## 第13月的月末没有超过冬至(不含冬至),说明今年含有13个月
        i = 1
        i += 1 while __hs[i+1]>__zq[2*i] && i<13 ## 在13个月中找第1个没有中气的月份
        __leap = i
        while i<14 do
          __ym[i] -= 1
          i += 1
        end
      end

      ## 名称转换(月建别名)
      i = 0
      while i<14 do
        _dm = __hs[i]+J2000; v2 = __ym[i] ## _dm初一的儒略日,v2为月建序号
        #mc = YMC[v2%12] ## 月建对应的默认月名称：建子十一,建丑十二,建寅为正……
        mc = v2%12
        # 参见：http://202.113.20.150/gj/showwords.asp?airid=251
        if _dm>=1724360 && _dm<=1729794 then
          # 王莽改用殷正，即以西汉孺子婴初始元年（公元8年）
          # 十二月为其始建国元年（公元9年）的正月，故初始元年没有十二月。
          # 到西汉淮阳王复夏正，即以王莽地皇四年（公元23年）的十一月为其更始元年的
          # 十月，故这一年有两个十月。
          #mc = YMC[(v2+1)%12] ## 8.01.15至 23.12.02 建子为十二,其它顺推
          mc = (v2+1)%12
        elsif _dm>=1807724 && _dm<=1808699 then
          # 魏明帝景初元年（公元237年）改用殷正，即以是年的三月为四月，故是年无三月。
          # 到景初三年（公元239年）十二月复夏正，放是年有两个十二月。
          #mc = YMC[(v2+1)%12] ## 237.04.12至239.12.13 建子为十二,其它顺推
          mc = (v2+1)%12
        elsif _dm>=1999349 && _dm<=1999467 then
          # 唐肃宗上元二年（公元761年）九月去年号，称元年，改用周正，以建子月为岁首，
          # 以十二辰为月名；至建已月又改元年为宝应元年（公元762年），复夏正，即仍以
          # 建寅月为岁首。代宗即位不改元，是年有两个十一月及十二月。
          #mc = YMC[(v2+2)%12] ## 761.12.02至762.03.30 建子为正月,其它顺推
          mc = (v2+2)%12
        elsif _dm>=1973067 && _dm<=1977052 then
          # 武则天改用周正，即以其永昌元年（公元689年）的十一月为其载初元年的正月，
          # 十二月为腊月，来年正月为一月，故永昌元年只有十个月。到其久视元年
          # （公元700年）十月复夏正，故是年有两个十一月及十二月。
          ## 689.12.18至700.11.15 建子为正月,建寅为一月,其它不变
          #mc = '正' if v2.remainder(12)==0
          mc = 2 if v2.remainder(12)==0
          #mc = '一' if v2==2
          mc = 14 if v2==2
        end

        # 这应该是搞历史的人去纠结的问题
        ## 239.12.13及23.12.02均为十二月,为避免两个连续十二月，此处改名
        #mc = '拾贰' if _dm==1729794||_dm==1808699

        __ym[i] = mc
        i += 1
      end

      return {:leap=>__leap, :ym=>__ym, :zq=>__zq, :hs=>__hs, :dx=>__dx}
    end

    # lunar.js end
  end
end